import React from 'react';
import Nav from '../Components/Nav';
import Button from 'react-bootstrap/Button';

function Timeline() {
    return ( 
        <div>
            <Nav />
            <h1>This is Timeline Page</h1>
            <Button as="input" type="reset" value="Reset" />

        </div>
     );
}

export default Timeline;
